    const [loading, setLoading] = useState(true);

    setTimeout( () => {
        setLoading(false);
    },5200);

    return (
        <div className="home col-md-12">
            { loading
                ?
                    <Container>
                        <HomeOver />
                    </Container>
                :
                    <Container>
                        <TodoForm counter={counter} addTodo={addTodo} />
                        <Table
                            todos={todos}
                            removeTodo={removeTodo}
                            uncompletedTodo={uncompletedTodo}
                            completedTodo={completedTodo}
                        />
                    </Container>
            }
        </div>
    );
};

export default Home;
